import axios from 'axios';

const handleEnroll = (userEmail, policyName) => {
  const registrationData = {
    userEmail: String(userEmail),
    policyName: String(policyName)
  };

  axios.post('http://localhost:8090/enrollement/reg', registrationData)
    .then(response => {
      console.log('Enrollment successful:', response.data);
      // Handle successful enrollment (e.g., show a success message, redirect, etc.)
    })
    .catch(error => {
      console.error('There was an error enrolling in the policy!', error);
      // Handle the error (e.g., show an error message to the user)
    });
};

// Example usage with user inputs
handleEnroll('maddy.mohith143@gmail.com', 'Maternity Health Plan');
